INSERT INTO `blog_post` VALUES ('Experience matters','experience-matters','2012-06-07 00:00:00',1,1,'Ripleys Management','<p>\r\n	Real life skills are often requested when being chosen for any work in film and TV, so make sure your agent knows about all your skills and experience&nbsp;so they can promote you to the best of their ability.</p>\r\n','<p>\r\n	When receiving information about new people, I always ask for a list of new recruit&rsquo;s hobbies, sports, past employment skills and any certificates or volunteer work that they think would be useful for the agency to display on their profile.&nbsp;</p>\r\n<p>\r\n	Actual life skills are often requested when being chosen for any work in film and TV, from background extras that may need to act like police or even librarians, cataloguing books.&nbsp;</p>\r\n<p>\r\n	A recent example of this was Isabel Harkensee&rsquo;s role on the current Salvos Stores TVC. She got this role predominantly because she is a likeable, mature age lady who we can all imagine working in a Salvos store. It just so happens that Isabel used life skills in her portrayal of the Salvos store worker as she has volunteered as a Salvos worker and also does Meals on Wheels volunteer work.&nbsp;</p>\r\n<p>\r\n	Make sure your agent knows about all your skills and experience so they can promote you to the best of their ability!</p>\r\n<p>\r\n	<em>DGM Advertising &ndash; Salvos Stores</em></p>\r\n','','',1594,'',1,'2012-06-05 18:05:29','2012-10-18 10:58:06'),('Family Ties','family-ties','2012-06-19 00:00:00',1,1,'Ripleys Management','<p>\r\n	Helsinki Agency needed a dad and his teenage son to spend some quality time on their basketball court, so we combined talent to create a sense of family.</p>\r\n','<p>\r\n	We were invited to supply father and son cast for the current Karcher TVC.</p>\r\n<p>\r\n	For action in the television commercial, Helsinki Agency needed a dad and his teenage son to clean around their basketball court; so they could shoot hoops.</p>\r\n<p>\r\n	The brief stated the pair needed great basketball skills as well as a family resemblance. Interestingly enough Mark Smith and Lars Vorlicek were cast. Mark coaches under 15 basketball and Lars plays competition basketball.&nbsp;These actors weren&rsquo;t related but looked fantastically similar.&nbsp;</p>\r\n<p>\r\n	With comic timing and expressions, basketball skills and acting ability, the campaign is a real success.</p>\r\n','','',19,'',2,'2012-06-20 17:57:04','2012-10-18 10:57:51'),('Flexibility is the key','flexibility-is-the-key','2012-07-01 00:00:00',1,0,'Ripleys Management','<p>\r\n	To work in this industry you must have flexibility in your schedule and be prepared to travel to different locations, every time you work.</p>\r\n','<p>\r\n	Monarch Digital Creative approached the agency to cast the lead in their Jacksons View TVC.&nbsp;The brief was healthy male in his 40s, husband and father, with presenter experience.</p>\r\n<p>\r\n	Guy Alexander is the depiction of this brief and has corporate video, lead role and presenter experience. Guy has also been involved in radio announcing so his voice is great for brand awareness.</p>\r\n<p>\r\n	As the Jackson&rsquo;s View Estate is in Drouin, there was travel involved and the shoot was completed on a weather hold day. To work in this industry you must have flexibility in your schedule and be prepared to travel to different locations, every time you work.</p>\r\n',NULL,NULL,21,'',3,'2012-07-04 17:57:58','2012-10-18 10:57:32'),('The spice of life','the-spice-of-life','2012-07-04 00:00:00',1,0,'Ripleys Management','<p>\r\n	The brand, mood and action must be captured in a single shot, so every kind of look, character or type has a place in photographic advertising.</p>\r\n','<p>\r\n	Photographic advertising is so different to television work because the brand, mood and action must be captured in a single frame.&nbsp;</p>\r\n<p>\r\n	Miss Bossy Boots, a well known Melbourne and Sydney based casting company contacted out agency. They were interested in organising some real characters for an SPC (Ardmona chopped tomatoes) stills shot, with Karen Martini. Karen Martini is a Melbourne celebrity chef and restraunteur so working closely with her is an experience that any actor would dearly appreciate and learn from.&nbsp;</p>\r\n<p>\r\n	Ripleys Management Australia provided bikers and pilots and grandparents, a whole array of amazing looks that were enjoying their tomato based meal.</p>\r\n<p>\r\n	I think it is important to note that every kind of look, character or other has a place in photographic advertising.</p>\r\n',NULL,NULL,20,'',4,'2012-07-04 17:59:45','2017-03-16 13:56:51');
/*!40000 ALTER TABLE `blog_post` ENABLE KEYS */;
UNLOCK TABLES;

