INSERT INTO `job` VALUES ('Test SMS','does this work?','\r\nI just need to know if i can use this feature?',3,'test-sms','2012-10-19 12:16:36','2017-06-26 23:29:30'),('Neighbours - Thursday 8th November - 6 hr call','Neighbours - Thursday 8th November - 6 hr cal','Booking for Neighbours - Thursday 8th November - 6 hr call. Please call me back asap to receive the booking',5,'neighbours-thursday-8th-november-6-hr-call','2012-11-05 14:05:01','2012-11-05 14:05:01'),('Ripleys Phone Database','Full Name, Email and Mobile Number','This is Clea from Ripleys Management. I need you to text me your full name, mobile number and email address (in that order). You must text this through to the Ripleys mobile number which is 0425763377. Please do this as soon as you can. I want to be able to save your details in the Ripleys phone. Please do not reply to this text message as it will not come to the Ripleys mobile, you need to send it to Cleas mobile - 0425763377. Thanks so much :-)',7,'ripleys-phone-database','2012-11-15 14:26:14','2012-11-15 14:26:14'),('Contact Details For Iphone','Text these details to Ripleys Mobile ASAP','Please text your full name, mobile number and email address to the ripleys mobile: 0425763377. I need these three things in the text to set you up as a contact. Please do this as soon as you read this message. If you have more than one email, please choose the email address that is connected to your mobile, can be checked via your mobile.',8,'contact-details-for-iphone','2012-11-28 18:30:32','2012-11-28 18:30:32'),('iphone details','Iphone Database','This is Clea from Ripleys. Please text me your full name, mobile number and email address to the Ripleys mobile ASAP - 0425763377. Do not reply to this number, send to the ripleys mobile',9,'iphone-details','2012-12-03 13:31:20','2012-12-03 13:31:20'),('Casting Networks','Casting Networks Profile','I have emailed you a username and password to fill in your Casting Networks Profile. Please do this. Whe you have completed your profile please send me a separate email back, with your username and password on it, explaining that you would like me to upload a photo for you. I need this sent as a separate email. I will then use your details to add a photo fro you. It helps me keep track of who has completed their profile measurements and other details.\r\nAny questions, email me. Kind regards, Clea',10,'casting-networks','2013-11-14 15:03:10','2013-11-14 15:03:10'),('from Ripleys','Re: open day','still checking if I can get this to work',12,'from-ripleys','2017-02-11 16:18:57','2017-02-11 16:18:57'),('hello','Does this feature work?','just checking if this feature works at all?',13,'hello','2017-05-01 20:58:15','2017-05-01 20:58:15'),('does this feature work title','does this feature work take 2','blah blah etc',14,'does-this-feature-work-title','2017-05-01 21:02:13','2017-05-01 21:02:13'),('broadcast','braodcast','does this broadcast work',16,'broadcast','2017-06-26 13:19:46','2017-06-26 13:19:46'),('hello from ripleys','hello from ripleys','hi there AM just checking if this broadcast works',17,'hello-from-ripleys','2017-08-01 14:39:00','2017-08-01 14:39:00'),('invitation to join ripleys','Invitation to join ripleys','Hi there,\r\nWe noticed you recently applied to the Ripleys agency. Just letting you know you have been selected to attend an interview for a place on the books. Ripleys has been very busy with lots of TVC\'s so please call or email the agency to make an appointment if you would like to be put forward for work opportunities. Kindest Regards, Karu',18,'invitation-to-join-ripleys','2017-08-14 18:01:19','2017-08-14 18:01:19');
