elbourne-based talent agency specialising in extras and character faces for Film and Television. </p>','','2012-10-24 10:42:00','2017-04-20 23:34:57','FAQs for Talent | Ripleys Management Melbourne'),(11,24,'<p>\r\n	Register with Ripleys Management Australia, a Melbourne-based talent agency specialising in extras, talent, and character faces.</p>\r\n','','2012-10-24 10:42:12','2012-10-26 17:55:32','Talent Registration Form | Ripleys Management Melbourne'),(12,21,'<p>\r\n	Get in touch with Ripleys Management Australia to book talent, register as an extra or enquire about our talent services.</p>\r\n','','2012-10-24 10:43:33','2012-10-26 17:56:24','Contact Ripleys | Talent and Extras Agency Melbourne'),(13,16,'<p>\r\n	Ripleys Management Australia is a Melbourne-based agency representing talent for television, films, TV commercials, photographic modelling and print advertising.</p>\r\n','','2012-10-24 10:43:44','2012-10-26 17:57:29','Terms & Conditions | Ripleys Management Australia'),(14,12,'<p>\r\n	Ripleys Management is a Melbourne-based agency representing talent for television, films, TV commercials, photographic modelling and print advertising.</p>\r\n','','2012-10-24 10:44:06','2012-10-26 17:57:55','Privacy | Ripleys Management Australia'),(15,22,'','','2012-10-26 17:56:52','2012-10-26 17:57:05','Sitemap | Ripleys Management Australia'),(16,27,'','','2012-11-01 12:22:09','2012-11-01 12:24:39','');
