INSERT INTO `ripleys_prop_content` VALUES (1,24,'Registration Form','','Need some help?','<p>\r\n	<u><strong>RIPLEYS BOOKS ARE CURRENTLY OPEN !</strong></u></p>\r\n<p>\r\n	Please complete the form to register your interest with&nbsp;<strong>Ripleys Management Australia.&nbsp;</strong></p>\r\n<ul>\r\n	<li>\r\n		Please do not leave any space blank, or the entire post may not get saved.</li>\r\n	<li>\r\n		Please&nbsp;click&nbsp; the&nbsp;&quot;Next&quot; tab below to proceed to the next page.&nbsp;</li>\r\n	<li>\r\n		Kindly ensure that your measurements are accurate and up-to-date (in cm, not inches).</li>\r\n</ul>\r\n<p>\r\n	<u><strong>PLEASE EXPECT A TEXT&nbsp; MESSAGE&nbsp; FROM US WITHIN A DAY OF YOUR SUBMISSION TO SET UP A TIME FOR AN INTERVIEW.&nbsp;</strong></u></p>\r\n<p>\r\n	Thank you for enquiring with Ripleys :-)&nbsp;</p>\r\n','2012-06-25 17:38:27','2020-10-30 00:42:39'),(2,21,'','','Contact Ripleys','<p>\r\n	Please use this form if you would like to contact Ripleys. We will get back to you shortly.</p>\r\n<p>\r\n	<a href=\"/for-agents/request-talent\"><span class=\"arrow-link\">MAKE A TALENT ENQUIRY</span></a></p>\r\n<p>\r\n	<a href=\"/for-talent/register\"><span class=\"arrow-link\">APPLY TO JOIN RIPLEYS TODAY</span></a></p>\r\n<p>\r\n	If you need to speak with me urgently please call the agency on: <strong>0425 763 377.</strong></p>\r\n<p>\r\n	Alternatively, please email: <a href=\"mailto:rm@ripleysmanagement.com.au\">rm@ripleysmanagement.com.au</a></p>\r\n','2012-06-25 17:44:10','2017-06-26 14:26:03'),(3,14,'How to join','<p class=\"lead\">\r\n	<u><strong>RIPLEY&#39;S BOOKS ARE NOW OPEN :-) FILL IN THE REGISTRATION FORM ON THE RIPLEYS WEBSITE TO BE CONTACTED FOR AN INTERVIEW.&nbsp;</strong></u></p>\r\n<p class=\"lead\">\r\n	&nbsp;</p>\r\n<p class=\"lead\">\r\n	Do you have flexible availability Monday-Friday and an excellent work ethic? If so, we may have a spot for you! Please note: Ripleys presently only lists Sydney and Melbourne-based talent from 10-100 years :-)</p>\r\n<p class=\"lead\">\r\n	You must be available at short notice during the week for auditions and castings.</p>\r\n<p class=\"lead\">\r\n	We are on the lookout for diversity in age, ethnicity, gender, look, build and skills to meet our clients&#39; needs. Please note: Ripleys represents only a select number of talent each year and places are <u>strictly</u> limited.</p>\r\n<p class=\"lead\">\r\n	If you would like to be considered for Ripley&#39;s, please complete the Registration Form here on the Ripleys site. Your expression of interest will then be held at Ripleys and we will contact you for an appointment.&nbsp;</p>\r\n<p>\r\n	All talent selected are listed with the agency for a 12 month period. You must not be currently listed with any other agency. Preference is given each year to talent with a proven record of availability and professional behaviour.</p>\r\n<p>\r\n	All successful applicants must attend an interview at the agency. Selection is made on the basis of your &#39;look&#39;, level of experience/training and availability. If selected you will be required to attend a professional photography shoot as specified by Ripleys Management Australia. All digital photographs remain the property of Ripleys for marketing purposes.</p>\r\n<h3>\r\n	For more information please call the agency on:&nbsp;Ph: 0425 763 377 - Monday-Friday during business hours.</h3>\r\n','Got Talent?','<p>\r\n	Use our online form to submit your details.</p>\r\n<p>\r\n	<a href=\"/for-talent/register\"><span class=\"arrow-link\">REGISTER WITH RIPLEYS</span></a></p>\r\n<p>\r\n	If you would like to get in touch with us urgently please call the agency on<br />\r\n	<strong>0425 763 377</strong>.</p>\r\n','2012-06-25 17:49:02','2018-09-24 15:21:30'),(4,16,'T&Cs','<h3>\r\n	<strong>Important information: </strong>Please read these terms and conditions before using this website. It should be understood that utilising the services of this website constitutes acceptance of the &#39;terms&#39; listed herewith.</h3>\r\n<h4>\r\n	Website Use</h4>\r\n<p>\r\n	Ripleys Management Australia hereby gives authorisation to view materials/photographs/information on this site for the purpose of personal and non-commercial use only. Photographs may be downloaded for professional/industry submissions only providing that all copyright and other proprietary notices contained in the original materials are retained. No materials/photographs may be modified in any way, nor shall they be publicly displayed, reproduced or distributed for any public or commercial use. The use of any photographs or materials from this website on any other website or networked computer environment for any purpose is strictly prohibited. All materials on this website are copyrighted. Any unauthorised use of any materials on this site will deem the user subject to penalties and in breach of copyright, trademark and other laws. If you seek to reproduce, download or otherwise use any such material in any manner which involves exercising the rights of the intellectual property owner, it is the responsibility of the user to seek permission for that reproduction or other use from Ripleys Management Australia or relevant third party/parties.</p>\r\n<h4>\r\n	Site Content</h4>\r\n<p>\r\n	This website has been researched and prepared solely for the purpose of providing information to film, television, advertising agencies, related industry and other website users. Ripleys Management Australia has compiled all information contained in this website in good faith and acts responsibly in ensuring that all information provided is accurate at the time of inclusion.</p>\r\n<h4>\r\n	Limitation of Liability</h4>\r\n<p>\r\n	To the maximum extent permitted by law, all warranties in respect of this website and the information contained in it (including content or use of this website, computer security in accessing this website, the availability, uptime and security of this website, computer viruses and the integrity of data accessed through this website) are excluded. Ripleys Management Australia excludes to the maximum extent permitted by law, any liability which may arise as a result of the materials/contents provided on this website.</p>\r\n<h4>\r\n	Important Information</h4>\r\n<p>\r\n	Ripleys Management Australia reserves the right to update/revise these terms and conditions at anytime at our discretion. It is the users responsibility to be made aware of any updates or revisions by regularly accessing this page.</p>\r\n','Contact Us','<p>\r\n	Ripleys Management Australia<br />\r\n	PO Box 582<br />\r\n	Malvern<br />\r\n	Victoria 3144</p>\r\n<p>\r\n	<span>TEL</span>: 0425 763 377</p>\r\n<p>\r\n	<a href=\"/contact\"><span>FIND MORE DETAILS ON OUR CONTACT PAGE&nbsp;&nbsp;<img alt=\"\" src=\"/img/icn-arrow.png\" /></span></a></p>\r\n','2012-06-26 12:10:25','2016-07-17 19:57:23'),(5,12,'Privacy & Legal','<h4>\r\n	Privacy</h4>\r\n<p>\r\n	Ripleys Management Australia takes privacy issues very seriously. All personal information contained on this website is used solely for the purpose of conducting business. It is a requirement of this industry for agents to provide accurate information to industry clients for the intention of obtaining work for our members. Ripleys Management Australia will provide information/details to clients when necessary for marketing and promotional purposes only.</p>\r\n<p>\r\n	Personal information on this website is not sold, reproduced or disclosed to any known third parties for the purpose of sending unsolicited e-mail or other advertising materials. In accordance with privacy laws all phone numbers and addresses remain private/secure and are not displayed or able to be otherwise accessed through this site. All information of this nature is held in strict privacy in Ripleys confidential files and can be accessed only by registered staff and the director of Ripleys Management Australia. The agency does not disclose any &#39;sensitive&#39; information to the public that could be used to directly communicate with any member registered with Ripleys Management Australia.</p>\r\n<p>\r\n	Children&rsquo;s information and photos, displayed on the website is done so, under strict permission from either a parent or legal guardian. As above, no &#39;sensitive&#39; information for any person under the age of 15 can be accessed through this website.</p>\r\n<p>\r\n	Ripleys Management Australia does however use &#39;cookies&#39; to obtain certain types of information from our users.</p>\r\n<p>\r\n	&#39;Cookies&#39; are small pieces of information that are stored on your computer&#39;s hard drive. When your web browser accesses www.ripleysmanagement.com.au cookies are used to store user information and to speed navigation and keep track of items. All information collected through our website with particular reference to the &#39;request talent&#39; section is held in strict confidentiality and not forwarded to any other parties. It must be noted that all information accessed in this section or via e-mail directly to Ripleys Management Australia, is provided to this company, on a voluntarily basis.</p>\r\n<p>\r\n	Ripleys Management Australia reserves the right to disclose personal information if required to do so by law or in good faith that such action is necessary to (1) defend or protect the rights or property of our users (2) protect the person safety of our users or the public or if Ripleys believes the disclosure is necessary to prevent or lessen a serious or immediate threat to a person&#39;s life or safety (3) to comply with law or legal processes served upon us at any time.</p>\r\n<p>\r\n	It is important for Ripleys to allow all members of this agency access to their own personal information and details which have been provided. Should you wish to edit or amend any such details including name, address, e-mail, phone and contact numbers, sizes or personal details- you may do so by contacting us via the e-mail link on this website or alternatively by contacting our customer service department directly on ph: 0425 763 377. Ripleys Management Australia endeavours to provide accurate information at all times for the benefit of talent and clients associated with us.</p>\r\n<p>\r\n	The use of the Ripleys Management Australia website constitutes acceptance of the collection and use of information as specified above.</p>\r\n<h4>\r\n	Legal</h4>\r\n<p>\r\n	The information supplied on this website is provided for the film, television and advertising industries.</p>\r\n<p>\r\n	All information/photographs/materials have been compiled from a variety of sources including reputable specialist sources and original contributions. All due care has been taken wherever possible to verify accuracy and reliability of information provided.</p>\r\n<h4>\r\n	Copyright Notice</h4>\r\n<p>\r\n	All information/photographs/materials displayed on this website are vested in or licenced to Extras Australia Pty Ltd trading as Ripleys Management Australia.</p>\r\n<p>\r\n	All persons affiliated or not affiliated with Ripleys Management Australia may browse this information subject to acceptance of the terms of use and privacy statements located on this website.</p>\r\n<p>\r\n	Thank you for taking the time to read and agree to these terms and conditions before perusing the website.<br />\r\n	&nbsp;</p>\r\n','Contact Us','<p>\r\n	Ripleys Management Australia<br />\r\n	PO Box 582<br />\r\n	Malvern<br />\r\n	Victoria 3144</p>\r\n<p>\r\n	<span>TEL</span>: 0425 763 377</p>\r\n<p>\r\n	<a href=\"/contact\"><span>FIND MORE DETAILS ON OUR CONTACT PAGE&nbsp;&nbsp;<img alt=\"\" src=\"/img/icn-arrow.png\" /></span></a></p>\r\n','2012-06-26 12:11:52','2020-08-26 17:29:13'),(6,13,'Working with Ripleys','<p class=\"lead\">\r\n	The employment of any person or persons registered with Ripleys Management Australia shall be deemed to constitute acceptance of the terms and conditions herewith.</p>\r\n<h4>\r\n	Television Drama, Films and Documentaries</h4>\r\n<p>\r\n	All talent bookings for film and television are minimum 4 hour calls. MEAA (equity) rates apply for background extras.</p>\r\n<h4>\r\n	Featured Extras, Bit Parts and Speaking Parts</h4>\r\n<p>\r\n	Minimum call time - 4 hours. Standard contracts at MEAA equity rates are considered the minimum negotiation. Negotiated contracts apply for featured, bit-part or lead actors.</p>\r\n<h4>\r\n	Television Commercials, Stills and Corporate Videos</h4>\r\n<p>\r\n	As per industry contract or otherwise negotiated. Residuals are payable on all footage aired outside the original contract term. It is the client&rsquo;s responsibility to provide the agency with contracts for commercials, stills or corporate videos, at the time of the booking. The client must notify the agency of any subsequent extended and or change in usage.</p>\r\n<h4>\r\n	Wardrobe and Make-up Calls</h4>\r\n<p>\r\n	Film and Television wardrobe and make-up calls are payable as per current MEAA (equity) rates. Television Commercial wardrobe will be paid at fee listed on contract or agreed between agency and casting company.</p>\r\n<h4>\r\n	Call Backs/Screentests</h4>\r\n<p>\r\n	Call backs for commercials, film and television drama are payable as per current MEAA(equity) rates.</p>\r\n<h4>\r\n	Post Sync</h4>\r\n<p>\r\n	Post Sync / Audio calls are payable as per current MEAA (equity) rates.</p>\r\n<h4>\r\n	Cancellations</h4>\r\n<p>\r\n	It is a requirement that 24 hours notice be given for all booking cancellations. Cancellation fees shall apply otherwise.&nbsp;</p>\r\n<h4>\r\n	Travel Time</h4>\r\n<p>\r\n	Not applicable for locations within a 20 km radius of Melbourne CBD. For all travel outside the Melbourne Metropolitan area- client may provide travel options or alternatively travel allowance is payble at MEAA (equity) rates.</p>\r\n<h4>\r\n	Photographic</h4>\r\n<p>\r\n	All photographic/stills are negotiated at the time of booking. Time and a half is applicable before 8am and after 6pm. Saturdays are billed at time and a half. Sundays and public holidays are billed at double time. Minimum call time for all photographic bookings is 2 hours.</p>\r\n<h4>\r\n	Usage</h4>\r\n<p>\r\n	Background extras are paid a one off casual rate for all bookings. Photographic and Televisions Commercial booking fees for featured-visual or lead talent will be inclusive of a negotiated usage fee. Length of use, Territory and intended mediums will be categorically listed in the terms and conditions of the contract. Usage can be local territory, rural or Australia only, unless authorised in writing for overseas or extended use. Additional fees are payable for the right to use photographs, footage, (reproductions, drawings or adaptations therefrom) either in part or whole for all known or anticipated countries other than Australia. Use of stills, voice-overs and footage other than originally booked will incur an additional fee. All posters, billboards, packages, point of sale and brochures carry a loading. Please check with the agency for these at the time of booking.</p>\r\n<h4>\r\n	PAYG</h4>\r\n<p>\r\n	PAYG is completed by the employer of the extra or actor. The employer is the production company or advertising client. Ripleys Management Australia is not the employer of the extra or actor but the representative of the individual being employed. As an agency we do not employ directly any person listed with us. Ripleys provides work opportunities for extras/actors and is the contact point between production/advertising companies and extras/actors. All talent fill out employment declaration forms on their first day of each work assignment.</p>\r\n<h4>\r\n	Photographic Fittings/Wardrobe Calls</h4>\r\n<p>\r\n	1hr &ndash; 2.5hr or otherwise negotiated (minimum agreed rate MEAA).</p>\r\n<h4>\r\n	Stills to Air</h4>\r\n<p>\r\n	Hourly rate plus loading fee applies.</p>\r\n<h4>\r\n	Payment</h4>\r\n<p>\r\n	Ripleys Management Australia reserves the right to invoice for all talent bookings once agreed and commenced and are deemed to be payable whether or not usage is appropriated.</p>\r\n<h4>\r\n	Meals</h4>\r\n<p>\r\n	It is the client&#39;s responsibility to provide meals for all bookings over 4 hours duration.</p>\r\n<h4>\r\n	Undertaking</h4>\r\n<p>\r\n	It is an express condition of this contract that all negotiations at any time for employment of talent mentioned herein or otherwise registered with Ripleys Management Australia be exclusively conducted through this office.</p>\r\n<h4>\r\n	Complaints</h4>\r\n<p>\r\n	In the event of a complaint- please call the agency directly on 0425 763 377 during business hours. Please be assured that all staff at Ripleys Management Australia consider any matter of complaint to be deemed serious. We will therefore endeavour to resolve any issue most professionally and promptly.</p>\r\n<h4>\r\n	Terms</h4>\r\n<p>\r\n	Strictly 14 days from receipt of invoice.</p>\r\n','Contact Us','<p>\r\n	Ripleys Management Australia<br />\r\n	PO Box 582<br />\r\n	Malvern<br />\r\n	Victoria 3144</p>\r\n<p>\r\n	<span>TEL 0425 763 377</span>&nbsp;&nbsp;</p>\r\n<p>\r\n	<a href=\"/talent\"><span class=\"arrow-link\">BROWSE TALENT</span></a></p>\r\n<p>\r\n	<a href=\"/for-agents/request-talent\"><span class=\"arrow-link\">REQUEST TALENT</span></a></p>\r\n','2012-06-26 17:46:27','2021-12-22 10:34:34'),(7,15,'Frequently Asked Questions','<h4>\r\n	What work does Ripleys do?</h4>\r\n<p>\r\n	Ripleys promotes talent in all areas of the film, television and photographic industry. We supply extras, featured extras, character faces and actors for feature films, commercials, television drama, mini-series, comedy, documentaries, music videos, education and training films, theatre and short or independent films. Ripleys has supplied talent for over 21 years and work with top industry clients.</p>\r\n<p>\r\n	Ripleys also provides talent for online and print advertising material for websites, posters, billboards, point of sale, magazines and flyers.&nbsp;</p>\r\n<h4>\r\n	How many people do we represent?</h4>\r\n<p>\r\n	As Ripleys Management Australia is a small boutique agency our places are <u>strictly</u> limited. Ripleys Management Australia currently represents approximately 300 dedicated individuals.&nbsp;</p>\r\n<h4>\r\n	How do we promote and market you?</h4>\r\n<p>\r\n	Every person listed with Ripleys has a profile page and is suggested to clients via individual submissions. It is a requirement for all talent to be promoted via Composite Cards incorporating a headshot and a reference full length photo. These promotional tools provide maximum exposure to clients. Acting CVs or showreels (if supplied) are also added to submissions according to the roles being pitched for.&nbsp;&nbsp;</p>\r\n<h4>\r\n	Who are our clients?</h4>\r\n<p>\r\n	As Ripleys is predominantly a film and television agency we deal mainly with casting directors and production companies associated with major television networks. Check out the homepage to see who we&#39;ve worked with. We also work with advertising agencies, producers, independent film makers, photographic stylists and photographic studios.</p>\r\n<h4>\r\n	Do I need a portfolio?</h4>\r\n<p>\r\n	No. Portfolios are not necessary for actors and extras. Unpolished images are the best reference for Film and Television assignments. If you are being considered for work at a featured visual or lead level, clients will request you for an casting so that they may see you in person to determine your suitability for a role. Ripleys provides clients with an up-to-date and accurate photographic database.</p>\r\n<h4>\r\n	Do I need transport or a tax file number?</h4>\r\n<p>\r\n	Yes. You should have access to your own transport and a &nbsp;tax file number. As an agency we are NOT your employer. You are employed by the production company on each assignment. You will be required to fill in a Tax Declaration for every job. Many jobs in this industry will call you to locations that are not near public transport. It is also important to arrive 10 minutes earlier than your call time to avoid being late. Punctuality and professionalism are imperative for work on set through this agency.</p>\r\n<h4>\r\n	Can I register with more than one agency?</h4>\r\n<p>\r\n	No. Registering with more than one agency at a time causes confusion with the clients. Ripleys represents talent each year on the understanding that they are <u>not</u> currently listed with any other agency. Any talent who does not disclose multiple representation will be immediately terminated from Ripleys Management books.</p>\r\n<h4>\r\n	Important information</h4>\r\n<p>\r\n	The film, television and modelling industry is an unpredictable and highly competitive industry. It is important to remember that all agency work is <u>casual</u> and that <u>no agency can guarantee work</u>. Clients choose talent for work assignments from our photos, agency submissions and from this website. Clients reserve the right to choose talent at their own discretion.&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n','Got Talent?','<p>\r\n	Use our online form to submit your details.</p>\r\n<p>\r\n	<a href=\"/for-talent/register\"><span class=\"arrow-link\">REGISTER WITH RIPLEYS</span></a></p>\r\n<p>\r\n	If you would like to get in touch with us urgently, please call the agency on<br />\r\n	<strong>0425 763 377</strong>.</p>\r\n','2012-06-26 17:48:19','2021-12-22 10:29:49'),(8,23,'','','Need some help?','<p>\r\n	Take your time and choose some Ripleys people from our <a href=\"/talent\">Talent list</a>.</p>\r\n<p>\r\n	Alternatively, enter your talent requirements in this form and we will get back to you as soon as we can.</p>\r\n<p>\r\n	If you would like to get in touch with us urgently, please call the agency on<br />\r\n	<strong><span style=\"line-height: 1.5;\">0425 763 377</span><span style=\"line-height: 1.5;\">.</span></strong></p>\r\n','2012-06-26 17:49:17','2016-07-18 09:14:52'),(9,11,'About Us','<h3>\r\n	Ripleys Management Australia</h3>\r\n<p class=\"lead\">\r\n	Ripleys Management Australia is a small boutique agency representing extras and interesting/character faces for Film,Television, TV commercials, photographic modelling and print advertising.</p>\r\n<p>\r\n	Ripleys is based in Melbourne and is owned and operated by <a href=\"https://www.linkedin.com/in/karubalasundram\" name=\"Karu Balasundram\" target=\"_blank\">Karu Balasundram</a> and represents only a select number of talent from everyday looking or corporate to &#39;interesting&#39; and &#39;character&#39; faces.</p>\r\n<p>\r\n	Ripleys endeavours to personally meet client&#39;s needs by providing them with an accurate and efficient talent database. We only offer places to talent who are reliable and have good flexibility in their Monday-Friday week. Ripleys is committed in this industry to providing the best personal service to our clients and our talent.</p>\r\n<p>\r\n	All Ripleys talent are marketed to clients each year through individual photographic submissions and via this site <a href=\"http://www.ripleysmanagement.com.au\">www.ripleysmanagement.com.au</a>. Ripleys also utilises the latest technology providing clients with talent profile pages that may include resumes, showreels, chats to camera and other information.</p>\r\n<p class=\"blockquote\">\r\n	Ripleys is dedicated to providing clients with professionally screened talent and exceptional industry service.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<h3>\r\n	So what&#39;s next?</h3>\r\n<p>\r\n	<a class=\"more\" href=\"/talent\"><span>Search for talent</span></a> <span class=\"sep\"> OR</span> <a class=\"more\" href=\"/for-talent/register\"><span>Talent Registration</span></a></p>\r\n','Contact Us','<p>\r\n	Extras Australia Pty Ltd</p>\r\n<p>\r\n	Ripleys Management Australia<br />\r\n	PO Box 582<br />\r\n	Malvern<br />\r\n	Victoria Australia 3144</p>\r\n<p>\r\n	<span>TEL</span>&nbsp; +61 425 763 377</p>\r\n<p>\r\n	<a href=\"/contact\"><span class=\"arrow-link\">MORE DETAILS ON OUR CONTACT PAGE</span></a></p>\r\n','2012-06-26 17:50:57','2017-11-23 14:38:02'),(11,26,'','','Contact Us','<p>\r\n	Ripleys Management Australia<br />\r\n	PO Box 582<br />\r\n	Malvern<br />\r\n	Victoria 3144</p>\r\n<p>\r\n	<span>TEL</span>&nbsp; 0425 763 377</p>\r\n<p>\r\n	<a href=\"/contact\"><span class=\"arrow-link\">MORE DETAILS ON OUR CONTACT PAGE</span></a></p>\r\n','2012-10-09 16:42:07','2017-03-14 21:16:01'),(12,27,'Registration Process','<h3>\r\n	Have you got what it takes to work in this industry?</h3>\r\n<p>\r\n	Every new registrant will be interviewed and offered a listing if found to be suitable, provided there are vacancies on Ripleys&#39; books. Please read through the information under Registration Process and choose either option 1 or 2 when completing your Talent Registration Form.</p>\r\n<p>\r\n	We encourage people who are reliable, professional and who can take direction well to apply. The agency helps you step into the industry with a professional edge but keeps costs for you very low so you start work straight away.&nbsp; Please only complete a Registration Form if you are truly interested in this work.</p>\r\n<p>\r\n	You can choose either Option 1 or Option 2:</p>\r\n<h4>\r\n	Option 1 &nbsp;</h4>\r\n<ul>\r\n	<li>\r\n		Interview with Ripleys Management</li>\r\n	<li>\r\n		Photography &ndash; At least 4 Digital headshots&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</li>\r\n</ul>\r\n<p>\r\n	<strong>Total cost: $320</strong>&nbsp;(50% payable before the photoshoot).</p>\r\n<h4>\r\n	Option 2 - Photography and professionally-directed actor&#39;s showreel</h4>\r\n<ul>\r\n	<li>\r\n		Interview with Ripleys Management</li>\r\n	<li>\r\n		Photography &ndash;&nbsp; At least 4 Digital Headshots</li>\r\n	<li>\r\n		Recording a Showreel - includes studio booking, professional direction and video editing.</li>\r\n</ul>\r\n<p>\r\n	<strong>Total cost: $600</strong>&nbsp;($160 payable before the photoshoot, balance before showreel is filmed).&nbsp;</p>\r\n<p class=\"right\" color:=\"\" font-size:=\"\" lucida=\"\" margin-bottom:=\"\" margin-top:=\"\" sans=\"\" style=\"line-height: 22px; font-family: \">\r\n	<em>&nbsp;Receipt for registration fees issued when full monies received.&nbsp;</em></p>\r\n<p class=\"right\" color:=\"\" font-size:=\"\" lucida=\"\" margin-bottom:=\"\" margin-top:=\"\" sans=\"\" style=\"line-height: 22px; font-family: \">\r\n	<span style=\"color: rgb(139, 92, 41); font-size: 16px; text-transform: uppercase;\">Importance of Photographs</span></p>\r\n<p>\r\n	Multiple photographs are taken of you but we retain and use the best 4. These headshots and a full length photograph are displayed on the ripleys website and Casting Networks. The other photos will be used in individual submissions. Registration with Ripleys is for a 12 month period. Photographs must be updated every renewal of registration (every 12 months). Photographs are the most accurate way to promote talent in the film and television industry. Yearly registration renewal costs $320.&nbsp;</p>\r\n<h4>\r\n	Reasons to Include a SHOWREEL on your Profile Page</h4>\r\n<p>\r\n	Involving a showreel on your profile page can open the door to featured visual work on Television Commercials. Background extras are booked from headshots but if casting clients are looking at confidence in front of the camera, a short reel of you is a great promotional tool. Provide as much information as you can on your profile page (photos, CV audio reel, chat to camera). This will benefit your promotion through the agency website for all levels of work, in the Film and TV industry.</p>\r\n','Join Ripleys','<p>\r\n	Use our online form to submit your details.</p>\r\n<p>\r\n	<a href=\"/for-talent/register\"><span class=\"arrow-link\">REGISTER WITH RIPLEYS</span></a></p>\r\n<p>\r\n	If you would like to get in touch with us urgently please call the agency on<br />\r\n	<strong>0425 763 377</strong>.</p>\r\n','2012-11-01 12:22:09','2020-09-30 18:14:57');
